			console.log(data);
			let btn = document.getElementById("btn");
			let logo = document.getElementById("logo");
			let h = Boolean(document.body.clientWidth > document.body.clientHeight)?document.body.clientWidth:document.body.clientHeight;
			let w = Boolean(document.body.clientWidth < document.body.clientHeight)?document.body.clientWidth:document.body.clientHeight;
			logo.style.left = (w - 284)/2+"px";
			logo.style.top = h*.06+"px";
			btn.style.top = h*.8+"px";
			btn.style.left = (w - 150)/2+"px";
			btn.onclick = function(){
				window.mraid.open();
			}

			//调整声音
			function audioChange(){
				if(typeof(SoundManager)=='underfined')return;
				if(mraid.isViewable() == false){ 
					SoundManager.Instance.isMusic = false;
					SoundManager.Instance.isEffect = false;
					SoundManager.Instance.volume = 0;
				}else{
					//打开声音
					egret.log("打开声音");
					SoundManager.Instance.isMusic = true;
					SoundManager.Instance.isEffect = true;
					SoundManager.Instance.volume = 1;
				}
			}

			mraid.addEventListener("viewableChange",audioChange);

			if(mraid.isViewable()){
				console.log("view able is ready");
				egret.runEgret({
								renderMode: "webgl",
								audioType: 0,
								calculateCanvasScaleFactor: function(context) {
									var backingStore = context.backingStorePixelRatio ||
										context.webkitBackingStorePixelRatio ||
										context.mozBackingStorePixelRatio ||
										context.msBackingStorePixelRatio ||
										context.oBackingStorePixelRatio ||
										context.backingStorePixelRatio || 1;
									return (window.devicePixelRatio || 1) / backingStore;
								}
							});
			}
		});</script></body></html>
